                               |Insaniquarium v1.1|
                               +------------------+

+----------------+
|Game Description|
+----------------+

Dive into wild arcade action as you feed fish and fight aliens in the craziest aquarium around! Control and protect a colorful aquarium with fantastic fish and colorful sea creatures by keeping your friendly fish fed and happy.. and safe from alien intruders! 

Feed your fish, then quickly collect the coins they drop to upgrade to better food, amazing new fish species and awesome weapons. But make sure to use those weapons on all the ruthless extraterrestrial boss beasts, or you'll be sunk in an empty tank!

Originally released September 1st, 2004.

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

This game is compatible with Windows 2000, XP, Vista(32/64bit) and 7(32/64bit). Requires DirectX 8.0 or later. Processor requirements: 700MHz CPU or higher. RAM requirements: 256 MB or higher. Requires a DirectX-compatible Sound and Video card with at least 16 MB of video memory.

